import React from "react";

const FitEddy = () => {
  return (
    <div>
      <img
        src="./mvc.jpg"
        alt="haribo"
        style={{ width: "30%", borderRadius: "5%" }}
      ></img>
    </div>
  );
};

export default FitEddy;
